import React from 'react';

const Ordering = () => {
    return (
        <div className="other-sections" id="ordering">
            <h2>How to Order</h2>
            <p>To place your order, please call: <strong>630-426-7001</strong></p>
            <p>Note: All orders should be placed on or before Thursdays. Pick up is on weekends from Aurora IL.</p>
        </div>
    );
}

export default Ordering;
